import React, { useState } from "react";
import { Button, message, Modal, Row, Tag } from "antd";
import { useTranslation } from "react-i18next";
import { useNavigate } from "react-router-dom";

import ComTable from "@components/common/ComTable";
import useFetch from "@common/hooks/useFetch";
import PATH_URL from "@common/config/pathURL";
import { userApi } from "@services/apis/user";
import { LoadingOutlined, LogoutOutlined } from "@ant-design/icons";
import { formatDateTimeTable } from "@common/utils/dateHelper";
import { USER_TAG } from "@common/constant/masterData";
import { DATE_FORMAT_DISPLAY } from "@common/constant/date";

function UserTable() {
  const { t } = useTranslation();
  const navigate = useNavigate();
  const [loadingLogoutAllUser, setLoadingLogoutAllUser] = useState(false);
  const [refetch, setRefetch] = useState("");
  const [pagination, setPagination] = useState({
    page: 1,
    limit: 10,
    keyword: "",
  });

  const { loading, value } = useFetch(
    (ourRequest) => {
      return userApi.getUsers(pagination, ourRequest);
    },
    [pagination, refetch],
  );

  const totalPage = value?.paginate?.totalPage;
  const paginationProp = {
    position: ["bottomRight"],
    total: totalPage * pagination.limit,
    current: pagination.page,
    showSizeChanger: true,
  };

  const handleChangeTable = (paginate, _, sorter) => {
    setPagination((curState) => ({
      ...curState,
      page: paginate?.current,
      limit: paginate?.pageSize,
      sort:
        sorter.field &&
        `${sorter?.field}:${sorter?.order === "ascend" ? "asc" : "desc"}`,
    }));
  };

  const handleSearch = (keyWord) => {
    setPagination((curState) => ({
      ...curState,
      keyword: keyWord?.trim(),
      page: 1,
    }));
  };

  const handleDetailShow = (dataUser) => {
    navigate(`${PATH_URL.MANAGER_USER.DETAIL}`, { state: dataUser });
  };

  const handleLogoutAllUser = () => {
    setLoadingLogoutAllUser(true);
    userApi
      .logoutAllUser()
      .then((res) => {
        if (res.success) {
          message.success(t("managementUser.message.logoutAllUserSuccess"));
        }
      })
      .catch((err) => {
        message.error(t("managementUser.message.logoutAllUserErr"));
        throw new Error(err);
      })
      .finally(() => setLoadingLogoutAllUser(false));
  };

  const columns = [
    {
      title: t("managementUser.table.id"),
      dataIndex: "id",
      sorter: true,
    },
    {
      title: t("managementUser.table.name"),
      dataIndex: "username",
    },
    {
      title: t("managementUser.table.email"),
      dataIndex: "email",
    },
    {
      title: t("managementUser.table.fullName"),
      dataIndex: "profile",
      align: "center",
      render: (profile) => <span>{profile?.fullName}</span>,
    },
    {
      title: t("managementUser.table.phoneNumber"),
      dataIndex: "profile",
      render: (profile) => <span>{profile?.phoneNumber}</span>,
      align: "center",
    },
    {
      title: t("managementUser.table.birthday"),
      dataIndex: "profile",
      align: "center",
      render: (profile) => (
        <span>
          {profile?.birthday &&
            formatDateTimeTable(profile?.birthday, DATE_FORMAT_DISPLAY)}
        </span>
      ),
    },
    {
      title: t("managementUser.table.timesUserJoined"),
      dataIndex: "profile",
      render: (profile) => <span>{profile?.eventJoineds}</span>,
      align: "center",
    },
    {
      title: t("managementUser.table.userTick"),
      dataIndex: "yellowTick",
      render: (yellowTick) => (
        <span className="flex-center">
          {yellowTick ? <div className="user-tick" /> : ""}
        </span>
      ),
    },
    {
      title: t("managementUser.table.createdAt"),
      dataIndex: "createdAt",
      sorter: true,
      render: (createdAt) => <div>{formatDateTimeTable(createdAt)}</div>,
    },
    {
      title: t("managementUser.table.address"),
      dataIndex: "address",
    },
    {
      title: t("managementUser.table.userTag"),
      dataIndex: "tag",
      sorter: true,
      render: (tag) => (tag?.name ? <Tag color="cyan">{tag?.name}</Tag> : ""),
    },
  ];

  const titleTable = () => {
    return (
      <>
        {t("managementUser.title")}
        <Button
          icon={loadingLogoutAllUser ? <LoadingOutlined /> : <LogoutOutlined />}
          onClick={() => !loadingLogoutAllUser && handleLogoutAllUser()}
        >
          {t("managementUser.btnLogoutAllUser")}
        </Button>
      </>
    );
  };

  return (
    <div>
      <ComTable
        title={titleTable()}
        loading={loading}
        columns={columns}
        data={value?.data}
        pagination={paginationProp}
        onSearch={handleSearch}
        onClickRow={handleDetailShow}
        onChangeTable={handleChangeTable}
      />
    </div>
  );
}

UserTable.propTypes = {};

export default UserTable;
